import React, { useState } from 'react';
import '../stylesheets/home.css';
import store from "../store";
const Tasks = (store, list) => store.getState()[list].map(i =>
    <li>{i}</li>
)

store.subscribe(() => {

})
class List extends React.Component {
    render() {
        return <h1>Hello, {store.getState().ToDoObject[store.getState().CurrentList]}</h1>;
    }
}

export default List;
